import { Link } from 'react-router-dom'
import ItemList from '../item-list';
const PageHome = () =>{
const arr=[
    {
        id: 1,
        key: 1,
        name: 'XiaomI mi Note',
        brand: 'Xiaomi'
},
    {
        id: 2,
        key: 2,
        name: "Lenovo"

    }
];
    return (
        <div>
            <p>
                It's Home Page, my dear friend :)
                <br/>
                    <ItemList items={arr}/>
                <br/>
                <Link to='/item'>item page</Link>
            </p>
        </div>
  )
}
export default PageHome;
